export default ({ title, children }) => {
  return (
    <div className='md:px-10 xl:px-0 lg:max-w-5.5xl mx-auto py-5 overflow-x-hidden overflow-y-hidden w-ful'>
      <h3 className='pl-4 text-gray-850 text-2xl font-semibold py-3 '>
        {title}
      </h3>
      {children}
    </div>
  );
};
